import React from "react";
import Cards from "../../components/cards/Cards";
import hero_pic from "../assets/hero_pic.jpg";
import trophy_pic from "../assets/trophy_pic.jpeg";
import "./projects.css";

const Projects = () => {
  return (
    <div className="projects">
      <h1>My Projects</h1>
      <div className="project__list">
        <Cards name="Dockerized Microservices" image={hero_pic} />
        <Cards name="Prosthetic Arm" image={trophy_pic} />
      </div>
    </div>
  );
};

export default Projects;
